      "author_association": "MEMBER",
      "body": "Here is a program:\r\n\r\n```racket\r\n#lang racket\r\n\r\n(module ctc racket\r\n  (provide rec-ctc)\r\n  (define rec-ctc (-> (recursive-contract rec-ctc))))\r\n\r\n(module f racket\r\n  (require (submod \"..\" ctc))\r\n  (provide (contract-out [f rec-ctc]))\r\n  (define (f) f))\r\n\r\n(module g racket\r\n  (require (submod \"..\" ctc))\r\n  (provide (contract-out [g (->i () [_ () rec-ctc])]))\r\n  (define (g) (Î» () #f)))\r\n\r\n(require 'f 'g)\r\n(f)\r\n((g))\r\n```\r\n\r\nThis program fails with the following error:\r\n\r\n```racket\r\nf: broke its own contract\r\n  promised: a procedure\r\n  produced: #f\r\n  in: the range of\r\n      (->\r\n       (recursive-contract\r\n        (-> ...vate/tmp/rec-bug.rkt:5:22)))\r\n  contract from: (/private/tmp/rec-bug.rkt f)\r\n  blaming: (/private/tmp/rec-bug.rkt f)\r\n   (assuming the contract is correct)\r\n```\r\n\r\nThis error is nonsensical, as `f` is not involved in the contract violation at all. The contract being broken in this case is between `g` and the enclosing module (and `g` should be blamed).\r\n\r\nThe issue here is that `recursive-contract` is too aggressive about caching its underlying projection. It caches a projection that has already been applied to a blame object, and it reuses it even when the blame object has changed, only providing the new negative party, leading to cases like the above.",
