      "body": "### DFSæ·±åº¦ä¼˜å…ˆéå†\r\n```\r\n<div class=\"root\">\r\n    <div class=\"child1\">\r\n        <a href=\"\">link</a>\r\n        <span>text</span>\r\n    </div>\r\n    <div class=\"child2\">\r\n        <span>2</span>\r\n    </div>\r\n</div>\r\n```\r\n\r\næ·±åº¦ä¼˜å…ˆéå†ç»“æœï¼š\r\n```\r\n[\r\n    div.root,\r\n    div.child1,\r\n    a,\r\n    span,\r\n    div.child2,\r\n    span\r\n]\r\n```\r\nDFSé€’å½’å®ç°ï¼š\r\næ·±åº¦ä¼˜å…ˆéœ€è¦ä¼˜å…ˆæŸ¥æ‰¾å­èŠ‚ç‚¹ï¼Œå› æ­¤éœ€è¦å®ç°åè¿›å…ˆå‡ºï¼ˆæ ˆï¼‰\r\n```\r\nfunction deepTraversal(node, nodeList) {\r\n    if (node) {\r\n        const children = node.children || []\r\n        nodeList.push(node)\r\n        for (let i = 0 ; i < children.length ; i++) {\r\n            deepTraversal(children[i], nodeList)\r\n        }\r\n    }\r\n    return nodeList\r\n}\r\n```\r\n>é€’å½’maybeå¯¼è‡´æ ˆæº¢å‡ºï¼ï¼ï¼\r\n\r\nDFSéå†å®ç°ï¼š\r\n```\r\nfunction deepTraversal(node) {\r\n    const nodeList = []\r\n    const stack = []\r\n    stack.push(node)\r\n    while (stack.length) {\r\n        let currentNode = stack.pop() // éœ€è¦åè¿›å…ˆå‡º\r\n        let children = currentNode.children\r\n        nodeList.push(currentNode)\r\n        for (let i=children.length - 1;i>=0;i--){\r\n            stack.push(children[i])\r\n        }\r\n    }\r\n    return nodeList\r\n}\r\n```\r\n\r\n\r\n\r\n### BFS å¹¿åº¦ä¼˜å…ˆéå†\r\n\r\nå¹¿åº¦ä¼˜å…ˆéœ€è¦ä¼˜å…ˆæŸ¥æ‰¾å…„å¼ŸèŠ‚ç‚¹ï¼Œå› æ­¤è¦å®ç°å…ˆè¿›å…ˆå‡ºï¼ˆé˜Ÿåˆ—ï¼‰\r\n\r\nBFSç»“æœï¼š\r\n```\r\n[\r\n    div.root,\r\n    div.child1,\r\n    div.child2,\r\n    a,\r\n    span,\r\n    span\r\n]\r\n```\r\n\r\nBFSé€’å½’å®ç°ï¼š\r\n\r\n```\r\n\r\nlet queen = [node]\r\nlet nodeList = []\r\nlet count = 0\r\n\r\nfunction bTraversal() {\r\n    let currentNode = queen[count]\r\n    if (currentNode) {\r\n\t\tlet children = currentNode.children || []\r\n        nodeList.push(currentNode)\r\n        queen.push(...children)\r\n        count ++\r\n        bTraversal(count)\r\n    }\r\n    return nodeList\r\n}\r\n```\r\n\r\nBFSéå†å®ç°ï¼š\r\n\r\n```\r\nfunction bTraversal(node) {\r\n    const nodeList = []\r\n    const queen = []\r\n    queen.push(node)\r\n    while (queen.length) {\r\n        let currentNode = queen.shift()\r\n        let children = currentNode.children\r\n        nodeList.push(currentNode)\r\n        for (let i=0;i<children.length;i++){\r\n            queen.push(children[i])\r\n        }\r\n    }\r\n    return nodeList\r\n}\r\n```\r\n",
