      "body": "* Background: Existing managed instance group of workers is used in backend services for global load balancing (HTTP/HTTPS Ingress) and exported for custom global load balancing use cases\r\n* Add and export a target pool of workers to allow custom regional load balancing for TCP/UDP applications (NodePort)\r\n* Health check for workers with a healthy Ingress controller. Forward rules (regional) to target pools don't support different external and internal ports so choosing nodes with Ingress allows possibly proxying\r\n* A target pool is a logical grouping only. It doesn't add costs to clusters or worker pools",
